import React from 'react'
import { Link } from 'react-router-dom';
const DUMMY_EVENTS=[{
    id:1,
    title:"Product_1",
},
{
    id: 2,
    title:"Product2",
},
{
    id:3,
    title:"Product3",
}
];
export default function Events() {
  return (
    <>
      <h1>Events Page</h1>
      {/* <Link >SDHSDHJ</Link> */}
      <ul>
        {DUMMY_EVENTS.map(event=>
          <li key={it.id}>
            {/* <Link to={`/events/${item.id}`}>{item.title}</Link> */}
            <Link to={it.id}>{it.title}</Link>
            </li>
        )}
      </ul>
    </>
  )
}
